import React from "react";
import './App.css';
import Pageheader from "./components/pageheader"
import Counter from "./components/counter"
import Homepage from "./components/homepage";
import AboutUs from "./components/aboutus";

function App() {
  return (
      <div>
          <AboutUs />
         <Homepage />
         <Counter />
      </div>
  );
}

export default App;
